import React from 'react';
import Slick from 'react-slick';
import { template } from '@babel/core';

const SliderTemplates = (props) => {
    const template = null;
    const settings = {
        dots:true,
        infinite:true,
        arrows:false,
        speed:500,
        slidesToShow: 1,
        slidesToScroll:1
    }
    return(
        <Slick {...settings}>
            {template}
        </Slick>
    )
}
export default SliderTemplates;
